import { ToastController } from 'ionic-angular';
import { Injectable } from '@angular/core';
import { SocialSharing } from '@ionic-native/social-sharing';

@Injectable()
export class ShareContentProvider {

  img: string = 'data:image/jpeg;base64,';

  // [Assinatura padro do aplicativo Talk Hawk]
  // private _signature: string = '\n Enviado do Aplicativo Talk Hawk !';


  constructor(private socialSharing: SocialSharing, private toast: ToastController) {
  }


  /**
   * Arrow function responsvel por validar os parmetros do mtodo 'shareOn'
   * @param name Nome da varivel impressa junto  mensagem de erro. Esse parmetro NO  obrigatrio.
   */
  private required = (name?) => { throw new Error(`O parmetro ${name || ''}  obrigatrio.`) };


  /**
   * Arrow function responsvel por compartilhar o progresso do usurio nas plataformas
   * suportadas pelo parmetro 'platform'
   * @param platform Aceita os valores: ['default', 'whatsapp', 'twitter' e 'facebook']
   * @param msg Mensagem compartilhada pelo usurio
   */
  public shareContent = async (
    platform: string = this.required('platform'),
    msg: string = this.required('msg')
  ) => {
    try {
      // [Concatena a mensagem  assinatura padro do Talk Hawk]
      // msg = `${msg} ${this._signature}`;

      switch (platform) {
        // [Envia para o menu 'compartilhar' do sistema operacional]
        case 'default':
          await this.socialSharing.share(msg, 'Talk Hawk app', this.img, 'https://google.com');
          break;

        case 'whatsapp':
          await this.socialSharing.shareViaWhatsApp(msg, this.img, 'http://google.com');
          break;

        case 'twitter':
          await this.socialSharing.shareViaTwitter(msg, null, null);
          break;

        case 'facebook':
          await this.socialSharing.shareViaFacebookWithPasteMessageHint(msg, this.img, null, 'Cole o texto no mural e compartilhe ;)');
          break;

        default:
          break;
      }

    } catch (error) {
      this.toast.create({
        message: 'Voc no tem esse aplicativo instalado no seu celular, por favor escolha algum outro.',
        duration: 4000,
        position: 'top',
        showCloseButton: true,
        closeButtonText: 'fechar',
        cssClass: 'toast-error'
      }).present();
    }

  };

}
